import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {apiResponse: ''}
    }

    callAPI() {
        fetch("http://localhost:9000/kings")
            .then(res => res.text())
            .then(res => this.setState({apiResponse: res}))
    }

    componentDidMount() {
        this.callAPI()
    }

    render() {
        let m = this.state.apiResponse;
        let items = m.map((elem) => {
            return <li> {elem} </li>
        });

        return (
            <div className="App">
                <ul>{items}</ul>
            </div>
        );
    }
}

export default App;
